import { createSelector } from 'reselect';
import { initialState } from './reducers';

const selectCart = (state) => state.order || initialState;

const selectOrder = createSelector(selectCart, (substate) => substate);
const selectOrderData = createSelector(selectCart, (substate) => substate);
const selectSuccess = createSelector(selectCart, (substate) => substate);
const selectLoading = createSelector(selectCart, (substate) => substate);
const select = createSelector(selectCart, (substate) => substate);

export default selectOrder;
export { selectOrder };
